import java.util.HashMap;
class isAnagram {
    public static boolean isAnagram(String s, String t) {
        HashMap<Character, Integer> str1 = new HashMap<>();
        HashMap<Character, Integer> str2 = new HashMap<>();

        if(s.length() != t.length()) return false;

        for (int i = 0; i < s.length() ; i++) {
                int count = str1.getOrDefault(s.charAt(i), 0);
                str1.put(s.charAt(i), count + 1);  

                int count2 = str2.getOrDefault(t.charAt(i), 0);
                str2.put(t.charAt(i), count2 + 1);        
            }
            
        for (int i = 0; i < s.length() ; i++) {
            if(str1.containsKey(s.charAt(i)) && str2.containsKey(t.charAt(i))){
            if ( !str1.get(s.charAt(i)).equals(str2.get(s.charAt(i))) ) return false ;
            }
        }
        return true;


    }
    public static void main(String[] args) {
        String s = "racecar";
        String t = "carrace";
        System.out.println(isAnagram(s, t));

        s = "jar" ;
        t = "jam" ;
        System.out.println(isAnagram(s, t));

        s = ""; t = "";System.out.println(isAnagram(s, t));

    }
}
